Framescript.script:
var root = this;


// Global Variables
this.goToFiltration = false;
this.stepCount = 1;


// Global Functions
this.resetInteractive = function() {
	this.gotoAndStop("AttractLoop");
}
this.toggleAnatomy = function() {
	if(this.ClosedMusselAnatomy.visible == false){
		// Toggle anatomy buttons
		this.HideAnatomyButton.visible 		= true;
		this.ShowAnatomyButton.visible 		= false;
		
		// Hide anatomy layers
		this.ClosedMusselAnatomy.visible 	= true;
		this.OpenMusselAnatomy.visible 		= true;
	} else {
		// Toggle anatomy buttons
		this.HideAnatomyButton.visible 		= false;
		this.ShowAnatomyButton.visible 		= true;
		
		// Show anatomy layers
		this.ClosedMusselAnatomy.visible 	= false;
		this.OpenMusselAnatomy.visible 		= false;
	}
}
this.toggleOpenClosed = function() {
	if(this.CloseMusselButton.visible == false) {
		this.gotoAndPlay("MusselOpening");
		this.CloseMusselButton.visible 		= true;
		this.OpenMusselButton.visible 		= false;
	} else {
		this.gotoAndStop("MusselClosed");
		this.CloseMusselButton.visible 		= false;
		this.OpenMusselButton.visible 		= true;
	}
}
this.toggleNav = function() {
	this.OpenMusselButton.visible 	= true;
	this.ShowAnatomyButton.visible 	= true;
	this.FiltrationButton.visible 	= true;
	this.LifeCycleButton.visible 	= true;
	this.HideAnatomyButton.visible 	= false;
	this.CloseMusselButton.visible 	= false;
}
this.hideAllNav = function() {
	this.OpenMusselButton.visible 	= false;
	this.ShowAnatomyButton.visible 	= false;
	this.FiltrationButton.visible 	= false;
	this.LifeCycleButton.visible 	= false;
	this.HideAnatomyButton.visible 	= false;
	this.CloseMusselButton.visible 	= false;
}
this.hideAnatomy = function() {
	this.ClosedMusselAnatomy.visible 	= false;
	this.OpenMusselAnatomy.visible 		= false;
}

this.playFiltration = function() {
	if(this.CloseMusselButton.visible == false){
		this.goToFiltration = true;
		this.gotoAndPlay("MusselOpening");
	} else {
		this.gotoAndPlay("FiltrationStep1");
	}
	this.hideAllNav();
	this.hideAnatomy();
}
this.playLifeCycle = function() {
	this.gotoAndPlay("LifeCycleStep1");
	this.hideAllNav();
	this.hideAnatomy();
}
this.closeAnimation = function() {
	this.gotoAndStop("MusselClosed");
	this.toggleNav();
	this.stepCount = 1;
}
this.nextStepFiltration = function() {
	this.stepCount++;
	this.gotoAndPlay("FiltrationStep" + this.stepCount);
}
this.nextStepLifeCycle = function() {
	this.stepCount++;
	this.gotoAndPlay("LifeCycleStep" + this.stepCount);
}
this.backToStartFiltration = function() {
	this.gotoAndPlay("FiltrationStep1");
	this.stepCount = 1;
}
this.backToStartLifeCycle = function() {
	this.gotoAndPlay("LifeCycleStep1");
	this.stepCount = 1;
}
this.attractLoopClose = function() {
	this.gotoAndPlay("MusselClosing");
	this.endFade(this.TapGetStarted);
	this.toggleNav();
}

this.timeout;
this.inout = true;
this.startFade = function(elem) {
	this.timeout = setInterval(function(){
		if (elem.alpha <= 1){
			if (root.inout){
				elem.alpha -= 0.025;
			} else {
				elem.alpha += 0.025;
			}
			if (elem.alpha >= 1){
				root.inout = true;          
			}
			if (elem.alpha <= 0.65){
				root.inout = false;          
			}
		}
	}, 100);
}
this.endFade = function(elem) {
	elem.alpha = 1;
	clearInterval(timeout);
}


// Nav Event Listeners
if (!this.OpenMusselButton._listeners.click){
	this.OpenMusselButton.addEventListener("click", this.toggleOpenClosed.bind(this));
	this.CloseMusselButton.addEventListener("click", this.toggleOpenClosed.bind(this));

	this.HideAnatomyButton.addEventListener("click", this.toggleAnatomy.bind(this));
	this.ShowAnatomyButton.addEventListener("click", this.toggleAnatomy.bind(this));

	this.FiltrationButton.addEventListener("click", this.playFiltration.bind(this));
	this.LifeCycleButton.addEventListener("click", this.playLifeCycle.bind(this));

	// Filtration Event Listeners
	this.CloseButtonFiltration.addEventListener("click", this.closeAnimation.bind(this));
	this.NextButtonFiltration.addEventListener("click", this.nextStepFiltration.bind(this));
	this.ReplayButtonFiltration.addEventListener("click", this.backToStartFiltration.bind(this));

	// LifeCycle Event Listeners
	this.CloseButtonLifeCycle.addEventListener("click", this.closeAnimation.bind(this));
	this.NextButtonLifeCycle.addEventListener("click", this.nextStepLifeCycle.bind(this));
	this.ReplayButtonLifeCycle.addEventListener("click", this.backToStartLifeCycle.bind(this));

	// Attract Loop Event Listeners
	this.AttractLoopButton.addEventListener("click", this.attractLoopClose.bind(this));
}

// Frame 1 Specific
this.stop();
this.hideAllNav();
this.hideAnatomy();
this.startFade(this.TapGetStarted);

this.goToFiltration = false;

this.CloseButtonFiltration.visible = true;
this.NextButtonFiltration.visible = true;
this.ReplayButtonFiltration.visible = false;

this.CloseButtonFiltration.visible = true;
this.NextButtonFiltration.visible = false;
this.ReplayButtonFiltration.visible = true;

this.CloseButtonLifeCycle.visible = true;
this.NextButtonLifeCycle.visible = true;
this.ReplayButtonLifeCycle.visible = false;

this.CloseButtonLifeCycle.visible = true;
this.NextButtonLifeCycle.visible = false;
this.ReplayButtonLifeCycle.visible = true;
